import styled from 'styled-components';

export const HighlightedText = styled.span`
  color: blue;  
`;

export const TodoContainer = styled.div`
  display: flex;
  flex-direction: row;
  height: 70px;
  font-size: 26px;
  align-items: center;
  border: 1px solid black ;
  box-sizing: border-box;
  padding: 5px;
  border-radius: 5px;
  margin: 10px 0 ;
`
